const numOfColumns = 2;

export default class Intro extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      showRealApp: false,
    };
  }
  renderItem = ({item, index}) => {
    if (item.empty === true) {
      return <View style={[styles.item, styles.itemInvisible]}></View>;
    }
    return (
      <TouchableOpacity
        onPress={() => {
          console.log(item.name);
        }}
        style={styles.item}>
        <ImageBackground
          source={{
            uri: item.url,
          }}
          style={{
            height: '100%',
            width: '100%',
            position: 'relative', // because it's parent
            top: 2,
            left: 2,
          }}>
          <Text style={styles.itemText}>{item.name}</Text>
        </ImageBackground>
      </TouchableOpacity>
    );
  };

  formatData = (data, numColumns) => {
    const numberOfFullRows = Math.floor(data.length / numColumns);
    let numOfElementsLastRow = data.length - numberOfFullRows * numColumns;

    while (numOfElementsLastRow !== numColumns) {
      data.push({
        key: `blank-${numOfElementsLastRow}`,
        empty: true,
      });
      numOfElementsLastRow = numOfElementsLastRow + 1;
    }
    return data;
  };

  _renderItem = ({item}) => {
    return (
      <View
        // eslint-disable-next-line react-native/no-inline-styles
        style={{
          borderColor: 'red',
          borderWidth: 1,
          backgroundColor: '#fdeb93',
          flex: 1,
          justifyContent: 'center',
          alignItems: 'center',
        }}>
        <View style={{marginTop: 40}}>
          <Title style={styles.title}>{item.title}</Title>
          <Title style={styles.title}>{item.text}</Title>
        </View>

        <FlatList
          data={this.formatData(data, numOfColumns)}
          renderItem={this.renderItem}
          numColumns={numOfColumns}
          style={styles.container}
        />
        {/* <Image
          source={item.image}
          style={{width: 200, height: 200, borderRadius: 300}}
        />
        <Text style={styles.text}>{item.text}</Text> */}
      </View>
    );
  };
  _onDone = () => {
    // User finished the introduction. Show real app through
    // navigation or simply by controlling state
    this.setState({showRealApp: true});
    this.props.navigation.navigate('tabs');
  };
  _renderDoneButton = () => {
    return (
      <View style={styles.buttonCircle}>
        <Icon name="md-checkmark" color="rgba(255, 255, 255, .9)" size={34} />
      </View>
    );
  };
  _renderNextButton = () => {
    return (
      <View style={styles.buttonCircle}>
        <Icon name="arrow-forward" color="rgba(255, 255, 255, .9)" size={24} />
      </View>
    );
  };
  // _renderSkipButton = () => {
  //   return (
  //     <View style={styles.buttonCircle}>
  //       <Text>Skip</Text>
  //     </View>
  //   );
  // };
  render() {
    if (this.state.showRealApp) {
      return <Intro />;
    } else {
      return (
        <AppIntroSlider
          // activeDotStyle={{
          //   backgroundColor: 'green',
          //   width: 50,
          //   marginLeft: -5,
          // }}
          // dotStyle={{backgroundColor: '#9fa39d', width: 70, marginLeft: -5}}
          activeDotStyle={{
            backgroundColor: '#21465b',
          }}
          renderItem={this._renderItem}
          data={slides}
          onDone={this._onDone}
          renderDoneButton={this._renderDoneButton}
          renderNextButton={this._renderNextButton}
          // renderSkipButton={this._renderSkipButton}
          // showSkipButton={true}
        />
      );
    }
  }
}

